@djronnelson is the godfather of hip-hop radio in Toronto and he’s just released his first rap album at the age of 60. In his song Culture Pirate, he directly calls out how Black artists’ music was plagiarised by white rock and roll artists. 

He sat down with @tomjoepower to look back at his journey as a pioneering hip-hop radio host. 

The full interview is available now on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

“Well, the director hates you.” 🥲

@sarahgadon has always made a point of choosing roles that offer her the complexity she needs in acting. In her 20s, sometimes that meant asking questions that got her into trouble with directors. 

The full interview with @tomjoepower is available now on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

“I want to be Michael Jordan!” 🌟

@riceboysleepsfilm director @anthonyshim originally wrote the film as a comedy, finding humour in the absurdity of his personal experiences immigrating to Canada from Korea as a child.

The full interview with @tomjoepower is available now on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

“I’ve never begun a forever before.” ❤

@feistmusic sat down with @tomjoepower to talk about becoming a mom, the impact of the ‘1234’ iPod commercial and her brand new album, Multitudes. 

The full interview is available now on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

Craig? Greg? 🥚? 

@nicholasbraun sat down with @tomjoepower to talk about the genius performances in @succession, his Disney era and almost getting Michael Cera’s part in Superbad. 

The full interview is available now on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

“I kind of solidified myself as this person who ruins films.”

@tomholland2013 talks to @tomjoepower about starring in the intense new miniseries The Crowded Room, how he never meant to become an actor, and the unimaginable fame that comes with the role of Spider-Man.

Catch the full chat wherever you listen to podcasts. 🔗Link in bio.

@thetimmcgraw shares the remarkable story of meeting his father for the first time as a teenager.

He sat down with @tomjoepower to talk about his career and how he reacted when he found out Taylor Swift had named a song after him. 

Listen to the full interview wherever you listen to podcasts. 🔗Link in bio.

@jojokomiller from @thebeachesband dives into the true meaning of the band’s hit single, Blame Brett. 

Her and her sister and bandmate @kmylli sat down with @tomjoepower to talk about what happens when you’re told “this is your make it or break it album,” how TikTok has expanded their audience, and how writing a breakup record felt like going to therapy with your best friends.

Watch the full interview with Jordan and Kylie on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

@hozier on success vs. fulfillment and realizing the picture you had of success in your head doesn’t match how you thought you would feel when you achieved it.

He sat down with @tomjoepower in the studio to talk about how his latest album, Unreal Unearth, draws inspiration from the nine circles of hell in Dante’s Inferno and the resonance of Take Me to Church in 2023.

Listen to the full conversation with Hozier wherever you listen to podcasts. 🔗Link in bio.

“I was painting his portrait from that period ... feeling nothing but gratitude. All of the bullsh*t just fell away.”

@joancbaezofficial joined @tomjoepower over Zoom and talked about the ups and downs of her relationship with Bob Dylan, her career in music, what it means to leave behind an honest legacy and what she’s most proud of.

Listen to the full interview with Joan wherever you listen to podcasts. 🔗Link in bio.

“Imagine if Kevin McCallister got ‘Home Aloned’ in the Poltergeist house.” 

@thejinkx and @bendelacreme stopped by the studio ahead of their Toronto stop on “The Jinkx & DeLa Holiday Show” tour. They told @tomjoepower about the holiday specials that inspired them, how they build a sense of safety and community at their shows, and what keeps them coming back to collaborate with one another every year.

The full interview is available on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

@jeremyallenwhitefinally tells @tomjoepower about capturing the love and bond of the Von Erich brothers as he plays a real person for the first time in the new film, The Iron Claw.

He also shares how he learned that wrestling has much more to do with storytelling than he thought and the similarities between himself and the character he plays on the series, The Bear.

The full interview is available on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.

“Nobody knows what they’re doing. Nobody.”

@instadanjlevy and @tomjoepower talk self-doubt, how he went from the hilarious David Rose of #SchittsCreek to his mournful character Marc in his debut feature film, #GoodGrief, and his personal experiences with grief that inspired it.

The full interview is available on our YouTube channel and wherever you listen to podcasts. 🔗Link in bio.
